--  DDL for Trigger CHECK_STOCK_BEFORE_OUT
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "TEST_ACCOUNT"."CHECK_STOCK_BEFORE_OUT" 
BEFORE INSERT ON medicine_out
FOR EACH ROW
DECLARE 
    stock_amount INT;
BEGIN
    SELECT medicine_amount INTO stock_amount 
    FROM medicine_stock 
    WHERE medicine_name = :NEW.medicine_name 
    AND manufacturer = :NEW.manufacturer 
    AND production_date = :NEW.production_date;

    IF stock_amount < :NEW.purchase_amount THEN
        RAISE_APPLICATION_ERROR(-20001, '库存不足，无法出库');
    END IF;
END;
/
ALTER TRIGGER "TEST_ACCOUNT"."CHECK_STOCK_BEFORE_OUT" DISABLE;
