Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('皮肤科','我院皮肤科是同济大学皮肤病与性病专业医学博士、硕士学位授予点，2011年迁入新址，重新规划设置了符合标准的皮肤美容治疗室、激光治疗室、医学真菌室、皮肤病治疗室，独立收费挂号，宽敞明亮的就医环境吸引了众多的患者就诊。2012年科室成功入选同济医院特色学科群建设，立足上海，科室确定以皮肤美容和医学真菌作为学科发展重点方向，在院领导大力支持和新的学科带头人带领下，科室发展进入新一轮快速发展时期。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('消化内科','同济大学附属同济医院消化内科是上海市临床重点专科、医院重点学科。科室由消化内科门诊、病房、内镜诊治中心、同济大学消化疾病研究所以及同济医院急性消化道出血救治中心组成。是国家药物临床试基地，住院医师和消化专科医师规范化培训基地，中国消化病学院内镜培训基地，教育部博士、硕士学位授予点、博士后流动站。学科经过多年的发展形成了肝脏疾病研究、食管胃肠动力研究、早期胃肠道肿瘤内镜下治疗、胰腺疾病和组织样本库研究等四个特色亚专科。医疗特色消化科病房分三个病区，核定床位92张，年门诊量12万人次，出院病人5500人次。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('泌尿外科','泌尿外科是同济医院特色学科，教育部硕博士学位授予点，是具有国家药物临床试验资质的专业科室，住院医师规范化培训基地。拥有前列腺疾病、泌尿系结石、泌尿系肿瘤、尿道外科、泌尿生殖男科等 5 个亚学科。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('心血管内科','心血管内科为上海市重点学科，首批国家心血管专科医师规范化培训基地，国家心血管疾病介入诊疗基层普及培训基地，国家卫健委人才中心心律失常诊疗培训基地，国家放射与治疗临床医学中心核心单位，中国胸痛中心，中国房颤中心，中国心衰中心，高血压达标中心和优化冠心病介入培训基地。拥有心血管重症监护、冠脉介入、心脏电生理起搏、心律失常消融治疗、结构性心脏病介入治疗、肺血管病介入治疗、心力衰竭、高血压、超声心动、无创心电检查和心脏康复等专业组，亚专科齐全，诊疗规范，在国内具有多项特色优势技术。倡导“以病人为中心，规范诊治”的科室文化。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('口腔科','同济大学附属同济医院口腔科自1991年成立以来，经过几代人的不懈努力，目前发展为由口腔种植、口腔正畸、口腔外科、牙体牙髓病、牙周病、口腔修复、儿童口腔等多个亚专业组成，集医疗、科研、教学为一体的专业临床科室。科室技术力量雄厚，拥有一支工作严谨、爱岗敬业、临床诊疗经验丰富的人才队伍，科室除普通门诊外，还开设有牙周种植、口腔正畸、牙缺损缺失修复、儿童口腔疾病管理、舒适化口腔门诊等专家专病门诊。同济医院口腔科秉承“同舟济世，博医精诚”的精神，竭诚为广大患者提供优质服务。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('中医科','同济大学附属同济医院中医科是具有特色的独立临床学科，科室不仅是上海市综合性医院示范中医科，也是上海市中医治疗白细胞减少症特色专科。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('普通外科','同济医院普通外科是医院重点学科，国家首批住院医师和专科医师规范化培训基地，教育部硕士、博士学位授予单位。普通外科精细分为5个亚专业胃肠外科、肝胆胰外科、甲状腺外科、乳腺外科和血管外科，床位共134张，展开床位179张。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('呼吸科','呼吸与危重症医学科是同济大学临床医学博士和硕士学位授予点、全国呼吸与危重症医学科专科医师规范化培养基地，全国呼吸与危重症医学科规范化建设三级优秀单位，上海市医学会呼吸病学分会副主任委员单位，是集医疗、教学、科研为一体的创新型现代化呼吸专科。拥有普通床位数60余张，RICU床位12张，负责全院及上海市西北部地区的危重患者抢救工作。年门诊量80000人次以上，年住院患者3000余人次');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('内分泌代谢科','同济医院内分泌代谢科，专科能力评价位居全市三甲医院前十，连续五届被评为医院重点学科。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('急诊医学科','本科室诊疗范围包括急性心肌梗死、主动脉夹层、急性呼吸衰竭、休克、脓毒血症、心功能衰竭、脑血管意外、严重创伤、呼吸心跳骤停及其他急危重症。 ');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('眼科','医疗特色： 同济医院眼科各亚专科齐全，为广大患者提供最佳的医疗服务。 科室手术理念是眼球整体观、眼与全身整体观的重视，是国内少有能开展复杂眼前后节联合手术的机构。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('内科','内科学是医学领域的一个重要分支，专注于诊断、治疗和管理成人患者的各种内部疾病和疾病情况。本医院的内科医生均为985高校毕业生，医生了解身体各个系统的工作原理和如何应对与这些系统相关的各种疾病和疾病。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('神经内科','神经内科是同济大学附属同济医院特色学科，国家卫生计生委脑卒中防治工程“高级卒中中心”、中国卒中学会“综合卒中中心”、国家卫健委“高级认知中心”、全国“头痛中心”、上海市住院医师规范化培训及神经内科专科医师培训基地、上海市神经内科质量控制中心专家组成员单位、神经病学博士和硕士学位授予点。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('骨科','骨科是同济大学985、211工程重点建设学科，上海市重中之重重点建设学科，上海市重点专科，上海市一流学科B类建设计划主干学科，国家药物临床试验机构，国家住院医师与专科医师规范化培训基地，同济大学硕士、博士学位点，医院重点建设学科。建有脊柱外科、足踝外科、 关节外科以及创伤与骨肿瘤外科4个亚专科。拥有脊柱脊髓损伤再生修复教育部重点实验室、国家科技部重点领域创新团队。');
Insert into TEST_ACCOUNT.DEPARTMENT2 (DEPARTMENT_NAME,DEPARTMENT_DESCRIPTION) values ('检验科','上海市同济医院检验科是上海市医学会检验医学分会副主任委员单位、上海市公共卫生第四轮和第五轮三年行动计划重点建设学科、上海市同济医院特色学科。科室设有临床门急诊检验、临床生化检验，临床免疫检验、临床微生物检验、临床分子诊断5个亚专业。');
