Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('阿司匹林肠溶片','处方药 西药 医保甲类','本品用于抗血栓。临床用于预防一过性脑缺血发作、心肌梗死、心房颤动、人工心脏瓣膜、动静脉瘘或其他手术后的血栓形成。也可用于治疗不稳定型心绞痛。','乙酰水杨酸','3）50mg；','75mg-160mg','口服','本品用于抗血栓。临床用于预防一过性脑缺血发作、心肌梗死、心房颤动、人工心脏瓣膜、动静脉瘘或其他手术后的血栓形成。也可用于治疗不稳定型心绞痛。','每日一次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('莲花清瘟胶囊','非处方药 中药 医保甲类','本品用于治疗流行性感冒属热毒袭肺证，症见发热或高热，恶寒，肌肉酸痛，鼻塞流涕，咳嗽，头痛，咽干咽痛，舌偏红，苔黄或黄腻等。','连花清瘟胶囊','每粒0.35g','一次3粒','口服','本品用于治疗流行性感冒属热毒袭肺证，症见发热或高热，恶寒，肌肉酸痛，鼻塞流涕，咳嗽，头痛，咽干咽痛，舌偏红，苔黄或黄腻等。','一日三次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('维生素B2','处方药 维生素类药 医保乙类','维生素B2，西药名。为维生素类药。常用剂型有片剂、注射剂。用于预防和治疗维生素B2缺乏症，如口角炎、唇干裂、舌炎、阴囊炎、结膜炎、脂溢性皮炎等。',null,'每粒10mg','一次1-2片','口服','本品宜饭后服用。必须按推荐剂量服用，不可超量服用。对本品过敏者禁用，过敏体质者慎用。','一日三次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('布洛芬缓释胶囊','非处方药 西药 医保甲类','用于缓解轻至中度疼痛如头痛、关节痛、偏头痛、牙痛、肌肉痛、神经痛、痛经。也用于普通感冒或流行性感冒引起的发热。','异丁苯丙酸','每粒0.3g','一次1粒','口服','服用本品期间不得饮酒或含有酒精的饮料。本品最好在餐中或餐后服用。对本品及其他解热、镇痛抗炎药物过敏者禁用。过敏体质者慎用。','12小时一次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('感冒灵颗粒','非处方药 中药 非医保','本品用于感冒引起的头痛，发热，鼻塞，流涕，咽痛。',null,'每袋装10g（含对乙酰氨基酚0.2g）','一次10g','口服','忌烟、酒及辛辣、生冷、油腻食物。不宜在服药期间同时服用滋补性中成药。本品含对乙酰氨基酚、马来酸氯苯那敏、咖啡因。服用本品期间不得饮酒或含有酒精的饮料；不能同时服用与本品成份相似的其他抗感冒药。','一日三次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('板蓝根颗粒','非处方药 中药 医保乙类','本品用于肺胃热盛所致的咽喉肿痛、口咽干燥；急性扁桃体炎见上述证候者的功效。',null,'每袋装5g（相当于饮片7g）','一次5-10g（含蔗糖），或一次3-6g（无蔗糖）','口服','忌烟酒、辛辣、鱼腥食物。不宜在服药期间同时服用滋补性中药。','一日3-4次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('小柴胡颗粒','非处方药 中药 医保甲类','本品用于外感病，邪犯少阳证，症见寒热往来、胸胁苦满、食欲不振、心烦喜呕、口苦咽干。',null,'每袋装10g','一次1-2袋','口服','忌烟、酒及辛辣、生冷、油腻食物。 不宜在服药期间同时服用滋补性中药。 风寒感冒者不适用。 ','一日三次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('快克复方氨酚烷胺胶囊','非处方药 西药 医保乙类','本品用于缓解普通感冒及流行性感冒引起的发热、头痛、四肢酸痛、打喷嚏、流鼻涕、鼻塞、咽痛等症状，也可用于流行性感冒的预防和治疗。',null,'每粒含对乙酰氨基酚250mg，盐酸金刚烷胺100mg，马来酸氯苯那敏2mg，人工牛黄10mg，咖啡因15mg。','一次1粒','口服','用药3-7天，症状未缓解，请咨询医师或药师。服用本品期间不得饮酒或含有酒精的饮料。','一日两次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('金银花口服液','非处方药 中成药 非医保','本品用于暑热内犯所致的中暑、痱疹、疖肿、风热感冒，症见发热口渴、咽喉肿痛、痱疹鲜红、头部疖肿。',null,'每支装10ml','成人一次20ml,儿童一次10ml','口服','服药时饮食宜清淡。','一日三次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('藿香正气水','非处方药 中成药 医保甲类','本品用于外感风寒、内伤湿滞或夏伤暑湿所致的感冒，症见头痛昏重、胸膈痞闷、脘腹胀痛、呕吐泄泻；胃肠型感冒见上述证候者。',null,'每支装10ml','一次5-10ml','口服','忌烟、酒及辛辣、生冷、油腻食物，饮食宜清淡。不宜在服药期间同时服用滋补性中药。','一日两次');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('云南白药气雾剂','非处方药 中成药 医保甲类','本品用于跌打损伤，瘀血肿痛，肌肉酸痛及风湿疼痛。','云南白药喷雾','云南白药气雾剂每瓶重 50 克','每次适量喷于伤患处','外用','本品只限于外用，切勿喷入口、眼、鼻。','一日3-5次');
