Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('肠炎宁片','非处方药 中成药 医保乙类','本品用于大肠湿热所致的泄泻、痢疾，症见大便泄泻、或大便脓血、里急后重、腹痛腹胀；急慢性胃肠炎、腹泻、细菌性痢疾、小儿消化不良见上述证候者。','肠炎灵','糖衣片片心重0.28g','一次4-6片','口服','尚不明确。','一日三到四次，小儿酌减');
Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('同仁堂四神丸','处方药 中成药 医保甲类','本品用于肾阳不足所致的泄泻，症见肠鸣腹胀、五更溏泄、食少不化、久泻不止、面黄肢冷。',null,'每袋装9g','一次9g','口服','尚不明确。','一日1-2次');
