Insert into TEST_ACCOUNT.MEDICINE_DESCRIPTION (MEDICINE_NAME,MEDICINE_TYPE,APPLICABLE_SYMPTOM,VULGO,SPECIFICATION,SINGLEDOSE,ADMINISTRATION,ATTENTION,FREQUENCY) values ('清开灵颗粒','非处方药 中药 非医保','用于外感风热时毒、火毒内盛所致高热不退，烦躁不安，咽喉肿痛、舌质红绛、苔黄、脉数；上呼吸道感染，病毒性感冒，急性扁桃体炎，急性咽炎，急性气管炎，高热等症属上述证候者。',null,'每袋装3克（含黄芩甙20毫克）。','一次3～6g','口服','久病体虚患者如出现腹泻时慎用。','一日2～3次，儿童酌减或遵医嘱。');
